            return;
        }
        for(let roles of user.roles){
            if(roles.name === 'admin'){
                next();
                return;
            }
        }</code></pre>
</div>
</div>
</p>
<p>However, this seems like something I can better query to my database ?
How would I do this in mongoDB?</p>

