The ` fetch("/createpost", {...} ` is not working properly<p>The problem with the output is that when we click on the submit post button  , the backend sends the error
of please add all the fields . But if we click the button multiple times without doing any changes in the input or anything , the post is creates successfully . All the data is successfully getting stores in mongodb and cloudinary but the main issue is why the submit post button is not storing the data when clicked once but is doing its task when clicked twice or thrice . Following files are in main concern :-</p>
<p>CreatePost.js :-</p>
<pre><code>import React, { useState } from &quot;react&quot;;
import { useHistory } from &quot;react-router-dom&quot;;
import M from &quot;materialize-css&quot;;

const CreatePost = () =&gt; {
  const history = useHistory();
  const [title, setTitle] = useState(&quot;&quot;);
  const [body, setBody] = useState(&quot;&quot;);
  const [image, setImage] = useState(&quot;&quot;);
  const [url, seturl] = useState(&quot;&quot;);

  const postDetails = () =&gt; {
    const data = new FormData();
    data.append(&quot;file&quot;, image);
    data.append(&quot;upload_preset&quot;, &quot;insta-clone&quot;);
    data.append(&quot;cloud_name&quot;, &quot;manindercloud&quot;);
    fetch(&quot;https://api.cloudinary.com/v1_1/manindercloud/image/upload&quot;, {
      method: &quot;post&quot;,
      body: data,
    })
      .then((res) =&gt; res.json())
      .then((data) =&gt; {
        seturl(data.url);
      })
      .catch((err) =&gt; {
        console.log(err);
      });

    fetch(&quot;/createpost&quot;, {
      method: &quot;post&quot;,
      headers: {
        &quot;Content-Type&quot;: &quot;application/json&quot;,
        Authorization: &quot;Bearer &quot; + localStorage.getItem(&quot;jwt&quot;),
      },
      body: JSON.stringify({
        title,
        body,
        pic: url,
      }),
    })
      .then((res) =&gt; res.json())
      .then((data) =&gt; {
        if (data.error) {
          console.log(data.error);
          M.toast({ html: data.error, classes: &quot;#b71c1c red darken-4&quot; });
        } else {
          M.toast({
            html: &quot;Created post successfully!&quot;,
            classes: &quot;#66bb6a green lighten-1&quot;,
          });
          history.push(&quot;/&quot;);
        }
      })
      .catch((err) =&gt; {
        console.log(err);
      });
  };

  return (
    &lt;div
      className=&quot;card input-field&quot;
      style={{
        margin: &quot;30px auto&quot;,
        maxWidth: &quot;500px&quot;,
        padding: &quot;20px&quot;,
        textAlign: &quot;center&quot;,
      }}
    &gt;
      &lt;input
        type=&quot;text&quot;
        placeholder=&quot;title&quot;
        value={title}
        onChange={(e) =&gt; setTitle(e.target.value)}
      /&gt;
      &lt;input
        type=&quot;text&quot;
        placeholder=&quot;body&quot;
        value={body}
        onChange={(e) =&gt; setBody(e.target.value)}
